def return_binary_or_hexa(nums):
    a = nums[0]
    b = nums[3]

    missing_nums = set(range(a + 1, b)) - set(nums[1:3])
    if not missing_nums:
        return "" 

    total = sum(missing_nums)

    if total % 2 == 0:  
        return format(total, 'x')
    else:
        return format(total, 'b')
